\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cRoutine, in an intelligent man, is a sign of ambition.” —W.H. Auden\n\nDecember 20, 2016\n\u001c11\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat might you do to accomplish your 10-year goals in the next 6 months, if you had a gun against your head?” Now, let’s pause. Do I expect you to take 10 seconds to ponder this and then magically accomplish 10 years’ worth of dreams in the next few months? No, I don’t. But I do expect that the question will productively break your mind, like a butterfly shattering a chrysalis to emerge with new capabilities. The “normal” systems you have in place, the social rules you’ve forced upon yourself, the standard frameworks—they don’t work when answering a question like this. You are forced to shed artificial constraints, like shedding a skin, to realize that you had the ability to renegotiate your reality all along. It just takes practice.\n\nDecember 20, 2016\n\u001c14\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe superheroes you have in your mind (idols, icons, titans, billionaires, etc.) are nearly all walking flaws who’ve maximized 1 or 2 strengths. Humans are imperfect creatures. You don’t “succeed” because you have no weaknesses; you succeed because you find your unique strengths and focus on developing habits around them. To make this crystal-clear, I’ve deliberately included two sections in this book (pages 197 and 616) that will make you think: “Wow, Tim Ferriss is a mess. How the hell does he ever get anything done?” Everyone is fighting a battle you know nothing about. The heroes in this book are no different. Everyone struggles. Take solace in that.\n\nDecember 20, 2016\n\u001c18\n\u0011\n\u0011\n\n\nJane McGonigal\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat is something you believe that other people think is crazy? “That you should never publicly criticize anyone or anything unless it is a matter of morals or ethics. Anything negative you say could at the very least ruin someone’s day, or worse, break someone’s heart, or simply change someone from being a future ally of yours to someone who will never forget that you were unkind or unfairly critical. It’s so common today to complain or criticize others’ work on social media, or dogpile on someone for a perceived offense. I won’t do it. It’s not my job to\n\nDecember 20, 2016\n\u001c142\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cbe the world’s critic, and I’d rather not rule out any future allies.”\n\nDecember 20, 2016\n\u001c142\n\u0011\n\u0011\n\n\n5 Morning Rituals that Help Me Win the Day\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 20, 2016\n\u001c153\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 20, 2016\n\u001c153\n\u0011\n\u0011\n\n\nMind Training 101\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“We do not rise to the level of our expectations. We fall to the level of our training.”\n\nDecember 20, 2016\n\u001c154\n\u0011\n\u0011\n\n\nThree Tips from a Google Pioneer\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c1. Have a Buddy I learned this from my dear friend and mentor, Norman Fischer, whom we jokingly call the “Zen Abbot of Google.” We use the gym analogy. Going to the gym alone is hard, but if you have a “gym buddy” whom you commit to going with, you’re much more likely to go regularly. Partly because\n\nDecember 20, 2016\n\u001c159\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cyou have company, and partly because this arrangement helps you encourage each other and hold each other accountable (what I jokingly call “mutual harassment”). We suggest finding a “mindfulness buddy” and committing to a 15-minute conversation every week, covering at least these two topics: a. How am I doing with my commitment to my practice? b. What has arisen in my life that relates to my practice? We also suggest ending the conversation with the question, “How did this conversation go?” We instituted this in our mindfulness-based emotional intelligence program (Search Inside Yourself) and found it very effective.\n\nDecember 20, 2016\n\u001c159\n\u0011\n\u0011\n\n\nCoach Sommer—The Single Decision\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDealing with the temporary frustration of not making progress is an integral part of the path towards excellence. In fact, it is essential and something that every single elite athlete has had to learn to deal with. If the pursuit of excellence was easy, everyone\n\nDecember 20, 2016\n\u001c165\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1sFdOQH1pockjFiwC76hsAWSQP1Zqy3gVK76g7Bs","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1Xp20VmxLoqS-EojxbuiewIyiWWblgm0It9eEBXE","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd"