y":"as","st":"text","si":4283,"ei":4289,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="l+S+zDw0lPLRrihizAh9fDL2T1A"  nonce="l+S+zDw0lPLRrihizAh9fDL2T1A">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="l+S+zDw0lPLRrihizAh9fDL2T1A"  nonce="l+S+zDw0lPLRrihizAh9fDL2T1A">DOCS_modelChunk = [{"ty":"is","ibi":4290,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwould do it. In fact, this impatience in dealing with frustration is the primary reason that most people fail to achieve their goals. Unreasonable expectations timewise, resulting in unnecessary frustration, due to a perceived feeling of failure. Achieving the extraordinary is not a linear process. The secret is to show up, do the work, and go home. A blue collar work ethic married to indomitable will. It is literally that simple. Nothing interferes. Nothing can sway you from your purpose. Once the decision is made, simply refuse to budge. Refuse to compromise. And accept that quality long-term results require quality long-term focus. No emotion. No drama. No beating yourself up over small bumps in the road. Learn to enjoy and appreciate the process. This is especially important because you are going to spend far more time on the actual journey than with those all too brief moments of triumph at the end.\n\nDecember 20, 2016\n\u001c165\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf the commitment is to a long-term goal and not to a series of smaller intermediate goals, then only one decision needs to be made and adhered to. Clear, simple, straightforward. Much easier to maintain than having to make small decision after small decision to stay the course when dealing with each step along the way. Th is provides far too many opportunities to inadvertently drift from your chosen goal. Th e single decision is one of the most powerful tools in the toolbox.\n\nDecember 20, 2016\n\u001c165\n\u0011\n\u0011\n\n\nChris Sacca\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cGenerally, what all of this comes down to is whether you are on offense or defense. I think that as you survey the challenges in your lives, it’s just: Which of those did you assign yourself, and which of those are you doing to please someone else? Your inbox is a to-do list to which anyone in the world can add an action item. I needed to get out of my inbox and back to my own to-do list.”\n\nDecember 20, 2016\n\u001c168\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEmpathy Isn’t Just Good for Life, It’s Good for Business “As a builder, as an entrepreneur, how can you create something for someone else if you don’t have even enough glancing familiarity with them to imagine the world through their eyes?”\n\nDecember 20, 2016\n\u001c170\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cnever forget that underneath all the math and the MBA bullshit talk, we are all still emotionally driven human beings. We want to attach ourselves to narratives. We don’t act because of equations. We follow our beliefs. We get behind leaders who stir our feelings. In the early days of your venture, if you find someone diving too deep into the numbers, that means they are struggling to find a reason to deeply care about you.”\n\nDecember 20, 2016\n\u001c171\n\u0011\n\u0011\n\n\nMarc Andreessen\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe call our test ‘What do the nerds do on nights and weekends?’ Their day job is Oracle, Salesforce.com, Adobe or Apple or Intel or one of these companies, or an insurance company, bank [or they’re a student]. Whatever. That’s fine. They go do whatever they need to do to make a living. The question is: What’s the hobby? What’s the thing at night or on the weekend? Then things get really interesting.”\n\nDecember 20, 2016\n\u001c173\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTo do original work: It’s not necessary to know something nobody else knows. It is necessary to believe something few other people believe.\n\nDecember 21, 2016\n\u001c177\n\u0011\n\u0011\n\n\nArnold Schwarzenegger\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“I Wasn’t There to Compete. I Was There to Win.” I brought up of a photo of Arnold at age 19, just before he won his first big competition, Junior Mr. Europe. I asked, “Your face was so confident compared to every other competitor. Where did that confidence come from?” He replied: “My confidence came from my vision. . . . I am a big believer that if you have a very clear vision of where you want to go, then the rest of it is\n\nDecember 21, 2016\n\u001c179\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cmuch easier. Because you always know why you are training 5 hours a day, you always know why you are pushing and going through the pain barrier, and why you have to eat more, and why you have to struggle more, and why you have to be more disciplined. . . . I felt that I could win it, and that was what I was there for. I wasn’t there to compete. I was there to win.”\n\nDecember 21, 2016\n\u001c179\n\u0011\n\u0011"},{"ty":"te","id":"i.12","spi":4299},{"ty":"te","id":"i.13","spi":5256},{"ty":"te","id":"i.14","spi":5790},{"ty":"te","id":"i.15","spi":6222},{"ty":"te","id":"i.16","spi":6502},{"ty":"te","id":"i.17","spi":6988},{"ty":"te","id":"i.18","spi":7431},{"ty":"te","id":"i.19","spi":7634},{"ty":"te","id":"i.20","spi":8102},{"ty":"as","st":"paragraph","si":4290,"ei":4290,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true