alse,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="l+S+zDw0lPLRrihizAh9fDL2T1A"  nonce="l+S+zDw0lPLRrihizAh9fDL2T1A">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="l+S+zDw0lPLRrihizAh9fDL2T1A"  nonce="l+S+zDw0lPLRrihizAh9fDL2T1A">DOCS_modelChunk = [{"ty":"is","ibi":8500,"s":"\n\n\nDerek Sivers\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt’s not what you know, it’s what you do\n\nDecember 21, 2016\n\u001c187\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cconsistently\n\nDecember 21, 2016\n\u001c187\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHow to thrive in an unknowable future? Choose the plan with the most options. The best plan is the one that lets you change your plans.”\n\nDecember 21, 2016\n\u001c187\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen you’re earlier in your career, I think the best strategy is to just say ‘yes’ to everything. Every little gig. You just never know what are the lottery tickets\n\nDecember 21, 2016\n\u001c189\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cgraduate Berklee School of Music in two years instead of four. The standard pace is for chumps. The school has to organize its curricula around the lowest common denominator, so that almost no one is left out. They have to slow down, so everybody can catch up. But,’ he said, ‘you’re smarter than that.’ He said, ‘I think you could just buy the books for those, [skip the classes] and then contact the department head to take the final exam to get credit\n\nDecember 21, 2016\n\u001c189\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cknow you must be incredibly busy . . .’ and I always think, ‘No, I’m not.’ Because I’m in control of my time. I’m on top of it. ‘Busy,’ to me, seems to imply ‘out of control.’ Like, ‘Oh my God, I’m so busy. I don’t have any time for this shit!’ To me, that sounds like a person who’s got no control over their life.” TF: Lack of time is lack of priorities. If I’m “busy,” it is because I’ve made choices that put me in that position, so I’ve forbidden myself to reply to “How are you?” with “Busy.” I have no right to complain. Instead, if I’m too busy, it’s a cue to reexamine my systems and rules\n\nDecember 21, 2016\n\u001c191\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMy recommendation is to do little tests. Try a few months of living the life you think you want, but leave yourself an exit plan, being open to the big chance that you might not like it after actually trying it.\n\nDecember 21, 2016\n\u001c194\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe are whatever we pretend to be.’”\n\nDecember 21, 2016\n\u001c195\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen you’re thinking of how to make your business bigger, it’s tempting to try to think all the big thoughts, the world-changing, massive-action plans. But please know that it’s often the tiny details that really thrill someone enough to make them tell all their friends about you.\n\nDecember 21, 2016\n\u001c196\n\u0011\n\u0011\n\n\nAlexis Ohanian\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFounders have to realize the bar is set so low because most companies stopped giving a fuck so long ago. . . . It’s something that I really expect other founders to do, and it ends up being pretty easy. Compared to building out the actual site or architecting the back end, this doesn’t require a few years of programming expertise. It just requires you to gives lots of damns, which not enough people do.”\n\nDecember 23, 2016\n\u001c197\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOne of his questions for founders who apply to Y Combinator: “What are you doing that the world doesn’t realize is a really big fucking deal?”\n\nDecember 23, 2016\n\u001c197\n\u0011\n\u0011\n\n\n“Productivity” Tricks for the Neurotic, Manic-Depressive, and Crazy (Like Me)\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“The moment that you feel that, just possibly, you’re walking down the street naked, exposing too much of your heart and your mind and what exists on the inside, showing too much of yourself. That’s the moment you may be starting to get it right.” —Neil Gaiman, University of the Arts commencement speech\n\nDecember 24, 2016\n\u001c198\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWrite down the 3 to 5 things—and no more—that are making you the most anxious or uncomfortable. They’re often things that have been punted from one day’s to-do list to the next, to the next, to the next, and so on. Most important usually equals most uncomfortable, with some chance of rejection or conflict.\n\nDecember 24, 2016\n\u001c200\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWrite down the 3 to 5 things—and no more—that are making you the most anxious or uncomfortable. They’re often things that have been punted from one day’s to-do list to the next, to the next, to the next, and so on. Most important usually equals most uncomfortable, with some chance of rejection or conflict. For each item\n\nDecember 24, 2016\n\u001c200\n\u0011\n\u0011"},{"ty":"te","id":"i.21","spi":8524},{"ty":"te","id":"i.22","spi":8604},{"ty":"te","id":"i.23","spi":8656},{"ty":"te","id":"i.24","spi":8832},{"ty":"te","id":"i.25","spi":9036},{"ty":"te","id":"i.26","spi":9530},{"ty":"te","id":"i.27","spi":10168},{"ty":"te","id":"i.28","spi":10419},{"ty":"te","id":"i.29","spi":10494},{"ty":"te","id":"i.30","spi":10832},{"ty":"te","id":"i.31","spi":11278},{"ty":"te","id":"