Chunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="l+S+zDw0lPLRrihizAh9fDL2T1A"  nonce="l+S+zDw0lPLRrihizAh9fDL2T1A">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="l+S+zDw0lPLRrihizAh9fDL2T1A"  nonce="l+S+zDw0lPLRrihizAh9fDL2T1A">DOCS_modelChunk = [{"ty":"is","ibi":12583,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFor each item, ask yourself: “If this were the only thing I accomplished today, would I be satisfied with my day?” “Will moving this forward make all the other to-dos unimportant or easier to knock off later?\n\nDecember 24, 2016\n\u001c200\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat, if done, will make all of the rest easier or irrelevant?”\n\nDecember 24, 2016\n\u001c200\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBlock out at 2 to 3 hours to focus on ONE of them for today. Let the rest of the urgent but less important stuff slide. It will still be there tomorrow. TO BE CLEAR: Block out at 2 to 3 HOURS to focus on ONE of them for today. This is ONE BLOCK OF TIME. Cobbling together 10 minutes here and there to add up to 120 minutes does not work. No phone calls or social media allowed. If you get distracted or start procrastinating, don’t freak out and downward-spiral; just gently come back to your ONE to-do\n\nDecember 24, 2016\n\u001c200\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDon’t overestimate the world and underestimate yourself. You are better than you think. And you are not alone\n\nDecember 24, 2016\n\u001c201\n\u0011\n\u0011\n\n\nMatt Mullenweg\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAdvice to your 20-year-old self? “Slow down. I think a lot of the mistakes of my youth were mistakes of ambition, not mistakes of sloth. So just slowing down, whether that’s meditating, whether that’s taking time for yourself away from screens, whether that’s really focusing in on who you’re talking to or who you’re with\n\nDecember 24, 2016\n\u001c206\n\u0011\n\u0011\n\n\nTony Robbins\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLosers react, leaders anticipate.” “Mastery doesn’t come from an infographic. What you know doesn’t mean shit. What do you do consistently?”\n\nDecember 24, 2016\n\u001c209\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJim Rohn famously said, “If you let your learning lead to knowledge, you become a fool. If you let your learning lead to action, you become wealthy.”\n\nDecember 24, 2016\n\u001c210\n\u0011\n\u0011\n\n\nCasey Neistat\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen in doubt about your next creative project, follow your anger (see Whitney Cummings, page 477, and James Altucher, page 246).\n\nDecember 24, 2016\n\u001c218\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBen Franklin’s excellent advice: “If you would not be forgotten as soon as you are dead and rotten, either write things worth reading, or do things worth writing.”\n\nDecember 24, 2016\n\u001c218\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut what you can always compete on, the true egalitarian aspect to success, is hard work. You can always work harder than the next guy.” Casey walks the talk. He wak\n\nDecember 24, 2016\n\u001c219\n\u0011\n\u0011\n\n\nReid Hoffman\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c. if you’re trying to talk to someone else about some problem, and you’re trying to make progress, how do you make language as positive an instrument as possible? What are the ways that language can work, and what are the ways that language doesn’t work?” TF: One of my all-time favorite quotes from dear Ludwig is: “The limits of my language mean the limits of my world.” (Die Grenzen meiner Sprache bedeuten die Grenzen meiner W\n\nDecember 24, 2016\n\u001c226\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt Doesn’t Always Have to Be Hard “I have come to learn that part of the business strategy is to solve the simplest, easiest, and most valuable problem. And actually, in fact, part of doing strategy is to solve the easiest problem, so part of the reason why you work on software and bits is that atoms [physical products] are actually very difficult.”\n\nDecember 24, 2016\n\u001c226\n\u0011\n\u0011\n\n\nPeter Thiel\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you go back 20 or 25 years, I wish I would have known that there was no need to wait. I went to college. I went to law school. I worked in law and banking, though not for terribly long. But not until I started PayPal did I fully realize that you don’t have to wait to start something. So if you’re planning to do something with your life, if you have a 10-year plan of how to get there, you should ask: Why can’t you do this in 6 months? Sometimes, you have to actually go through the complex, 10-year trajectory. But it’s at least worth asking whether that’s the story you’re telling yourself, or whether that’s the reality.”\n\nDecember 24, 2016\n\u001c229\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat I prefer over trends is a sense of mission. That you are working on a unique problem that people are not solving elsewhere.\n\nDecember 24, 2016\n\u001c230\n\u0011\n\u0011"},{"ty":"te","id":"i.35","spi":12592},{"ty":"te","id":"i.36","spi":12840},{"ty":"te","id":"i.37","spi":12943},{"ty":"te","id":"i.38","spi":13485},{"ty":"te","id":"i.39","spi":13651},{"ty":"te","id":"i.40","spi":14028},{"ty":"te","id":"i.41","spi":14208},{"ty":"te","id":"i.42","spi":14413},{"ty":"te","id":"i.43","spi":14582},{"ty":"te","id":"i.44","spi":14785},{"ty":"te","id":"i.45","spi":15005},{"ty":"te","id":"i.46","spi":15475},{"ty":"te","id":"i.47","spi":15880},{"ty":"te","id":"i.48","spi":16549},{"ty":"as","st":"paragraph","si":12583,"ei":12583,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl