elChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="l+S+zDw0lPLRrihizAh9fDL2T1A"  nonce="l+S+zDw0lPLRrihizAh9fDL2T1A">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="l+S+zDw0lPLRrihizAh9fDL2T1A"  nonce="l+S+zDw0lPLRrihizAh9fDL2T1A">DOCS_modelChunk = [{"ty":"is","ibi":16708,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPeter has written elsewhere, “The next Bill Gates will not build an operating system. The next Larry Page or Sergey Brin won’t make a search engine. And the next Mark Zuckerberg won’t create a social network. If you are copying these guys, you aren’t learning from them.”\n\nDecember 24, 2016\n\u001c231\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThat strikes me as sort of a lack of diversity in our thinking about the kinds of things people should be doing. It’s very limiting for our society as well as for those students. I certainly think I was very much guilty of this myself, if I look back on my Stanford undergraduate and law school years. It’s possible I would do it again. But if I had to do something over, I would think about it much harder. I would ask questions. Why am I doing this? Am I doing this just because I have good grades and test scores and because I think it’s prestigious? Or am I doing this because I’m extremely passionate about practicing law? “I think there are good answers, and there are bad answers. And my retrospective on my early 20s is that I was way too focused on the wrong answers at the time.”\n\nDecember 24, 2016\n\u001c231\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI don’t like the word ‘education’ because it is such an extraordinary abstraction. I’m very much in favor of learning. I’m much more skeptical of credentialing or the abstraction called ‘education.’ So there are all of these granular questions like: What is it that we’re learning? Why are you learning it? Are you going to college because it’s a 4-year party? Is it a consumption decision? Is it an investment decision where you’re investing in your future? Is it insurance? Or is it a tournament where you’re just beating other people? And are elite universities really like Studio 54 where it’s like an exclusive nightclub? I think if we move beyond the education bubble that we’re living in today, the future will be one in which people can speak about these things more clearly.”\n\nDecember 24, 2016\n\u001c232\n\u0011\n\u0011\n\n\nSeth Godin\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTrust and attention—these are the scarce items in a post-scarcity world.”\n\nDecember 24, 2016\n\u001c234\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe blog post I point people to the most is called ‘First, Ten,’ and it is a simple theory of marketing that says: tell ten people, show ten people, share it with ten people; ten people who already trust you and already like you. If they don’t tell anybody else, it’s not that good and you should start over. If they do tell other people, you’re on your way.”\n\nDecember 25, 2016\n\u001c237\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTo Create Something Great (Or Eventually Huge), Start Extremely Small “My suggestion is, whenever possible, ask yourself: What’s the smallest possible footprint I can get away with? What is the smallest possible project that is worth my time? What is the smallest group of people who I could make a difference for, or to? Because smallest is achievable. Smallest feels risky. Because if you\n\nDecember 25, 2016\n\u001c237\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cpick smallest and you fail, now you’ve really screwed up. “We want to pick big. Infinity is our friend. Infinity is safe. Infinity gives us a place to hide. So, I want to encourage people instead to look for the small. To be on one medium in a place where people can find you. To have one sort of interaction with one tribe, with one group where you don’t have a lot of lifeboats.” (See “1,000 True Fans” on page 289.\n\nDecember 25, 2016\n\u001c237\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI think we need to teach kids two things: 1) how to lead, and 2) how to solve interesting problems. Because the fact is, there are plenty of countries on Earth where there are people who are willing to be obedient and work harder for less money than us. So we cannot out-obedience the competition. Therefore, we have to out-lead or out-solve the other people. . . . “The way you teach your kids to solve interesting problems is to give them interesting problems to solve. And then, don’t criticize them when they fail. Because kids aren’t stupid. If they get in trouble every time they try to solve an interesting problem, they’ll just go back to getting an A by memorizing what’s in the textbook. I spend an enormous amount of time with kids . . . I think that it’s a privilege to be able to look a trusting, energetic, smart 11-year-old in the eye and tell him the truth. And what we can say to that 11-year-old is: ‘I really don’t care how you did on your vocabulary test. I care about whether you\n\nDecember 25, 2016\n\u001c239\n\u0011\n\u0011"},{"ty":"te","id":"i.49","spi":16717},{"ty":"te","id":"i.50","spi":17028},{"ty":"te","id":"i.51","spi":17857},{"ty":"te","id":"i.52","spi":18694},{"ty":"te","id":"i.53","spi":18807},{"ty":"te","id":"i.54","spi":19206},{"ty":"te","id":"i.55","spi":19636},{"ty":"te","id":"i.56","spi":20093},{"ty":"as","st":"paragraph","si":16708,"ei":16708,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":16709,"ei":16709,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i"