:true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":21098,"ei":21116,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="l+S+zDw0lPLRrihizAh9fDL2T1A"  nonce="l+S+zDw0lPLRrihizAh9fDL2T1A">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="l+S+zDw0lPLRrihizAh9fDL2T1A"  nonce="l+S+zDw0lPLRrihizAh9fDL2T1A">DOCS_modelChunk = [{"ty":"is","ibi":21124,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001chave something to say.’”\n\nDecember 25, 2016\n\u001c239\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat’s something you believe that other people think is crazy? “Deep down, I am certain that people are plastic in the positive sense: flexible and able to grow. I think almost everything is made, not born, and that makes people uncomfortable because it puts them on the hook, but I truly believe it.”\n\nDecember 25, 2016\n\u001c239\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSend someone a thank-you note tomorrow.”\n\nDecember 25, 2016\n\u001c242\n\u0011\n\u0011\n\n\nJames Altucher\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJames recommends the habit of writing down 10 ideas each morning in a waiter’s pad or tiny notebook. This exercise is for developing your “idea muscle” and confidence for creativity on demand, so regular practice is more important than the topics: “What if [you] just can’t come up with 10 ideas? Here’s the magic trick: If you can’t come up with 10 ideas, come up with 20 ideas. . . . You are putting too much pressure on yourself. Perfectionism is the ENEMY of the idea muscle . . . it’s your brain trying to protect you from harm, from coming up with an idea that is embarrassing and stupid and could cause you to suffer pain. The way you shut [this] off is by forcing [the brain] to come up with bad ideas. “So let’s say you’ve written down 5 ideas for books and they are all pretty good. And now you are stuck. . . . Well, let’s come up with some bad ideas.\n\nDecember 25, 2016\n\u001c243\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI [then] divide my paper into two columns. On one column is the list of ideas. On the other column is the list of FIRST STEPS. Remember, only the first step. Because you have no idea where that first step will take you. One of my favorite examples: Richard Branson didn’t like the service on airlines he was flying, so he had an idea: ‘I’m going to start a new airline.’ How the heck can a magazine publisher start an airline from scratch with no money? His first step: He called Boeing to see if they had an airplane he could lease. No idea is so big that you can’t take the first step. If the first step seems too hard, make it simpler. And don’t worry again if the idea is bad. This is all practice.”\n\nDecember 26, 2016\n\u001c244\n\u0011\n\u0011\n\n\nScott Adams\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI’m thinking of these ideas and they’re flowing through my head, I’m monitoring my body; I’m not monitoring my mind. And when my body changes, I have something that other people are going to care about, too.” TF: B.J. Novak (page 378) has expressed something very similar. This bodily reaction—an involuntary half-chuckle, a rush of adrenaline, a surge of endorphins, a sharp change of emotions, etc.—can act as a metal detector for good material. It takes practice, but it works.\n\nDecember 26, 2016\n\u001c264\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cCapitalism rewards things that are both rare and valuable. You make yourself rare by combining two or more “pretty goods” until no one else has your mix\n\nDecember 26, 2016\n\u001c265\n\u0011\n\u0011\n\n\nThe Law of Category\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you didn’t get into the prospect’s mind first, don’t give up hope. Find a new category you can be first in. It’s not as difficult as you might think.\n\nDecember 27, 2016\n\u001c272\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cProspects are on the defensive when it comes to brands. Everyone talks about why their brand is better. But prospects have an open mind when it comes to categories. Everyone is interested in what’s new. Few people are interested in what’s better.\n\nDecember 27, 2016\n\u001c273\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen you’re the first in a new category, promote the category. In essence, you have no competition. DEC told its prospects why they ought to buy a minicomputer, not a DEC minicomputer. In the early days, Hertz sold rent-a-car service. Coca-Cola sold refreshment. Marketing programs of both companies were more effective back then.\n\nDecember 27, 2016\n\u001c273\n\u0011\n\u0011\n\n\nDan Carlin\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 27, 2016\n\u001c279\n\u0011\n\u0011\n\n\nEd Catmull\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“This is the big misconception that people have, that [in the beginning] a new film is the baby version of the final film, when in fact the final film bears no relationship to what you started off with. What we’ve found is that the first version always sucks. I don’t mean this because I’m self-effacing or that we’re modest about it. I mean it in the sense that they really do suck.”\n\nJanuary 1, 2017\n\u001c301\n\u0011\n\u0011"},{"ty":"te","id":"i.57","spi":21133},{"ty":"te","id":"i.58","spi":21197},{"ty":"te","id":"i.59","spi":21538},{"ty":"te","id":"i.60","spi":21635},{"ty":"te","id":"i.61","spi":22537},{"ty":"t