odelChunk = undefined;</script><script type="text/javascript" nonce="l+S+zDw0lPLRrihizAh9fDL2T1A"  nonce="l+S+zDw0lPLRrihizAh9fDL2T1A">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="l+S+zDw0lPLRrihizAh9fDL2T1A"  nonce="l+S+zDw0lPLRrihizAh9fDL2T1A">DOCS_modelChunk = [{"ty":"is","ibi":25353,"s":"\n\n\nTracy DiNunzio\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you spend your time focusing on the things that are wrong, and that’s what you express and project to people you know, you don’t become a source of growth for people, you become a source of destruction for people\n\nJanuary 1, 2017\n\u001c305\n\u0011\n\u0011\n\n\nChris Young\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthe job I was going to do hadn’t even been invented yet. . . . The interesting jobs are the ones that you make up. That’s something I certainly hope to instill in my son: Don’t worry about what your job is going to be. . . . Do things that you’re interested in, and if you do them really well, you’re going to find a way to temper them with some good business opportunity.”\n\nJanuary 1, 2017\n\u001c310\n\u0011\n\u0011\n\n\nNoah Kagan\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDon’t Try and Find Time. Schedule Time. On Tuesdays from 10 a.m. to 12 noon, Noah schedules nothing but “Learning.” This is a great reminder that, for anything important, you don’t find time. It’s only real if it’s on the calendar. My Wednesdays from 9 a.m. to 1 p.m. are currently blocked out for “Creation”—writing, podcast recording, or other output that creates a tangible “after” product. I turn off WiFi during this period to\n\nJanuary 1, 2017\n\u001c317\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cbe as non-reactive as possible. (See Neil Strauss, page 347, and Ramit Sethi, page 287.)\n\nJanuary 1, 2017\n\u001c317\n\u0011\n\u0011\n\n\nB.J. Novak\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJanuary 16, 2017\n\u001c367\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFor 2 to 4 weeks, the writers’ room banter was each person asking, “What if . . . ?” over and over again. Crazy scenarios were encouraged, not penalized. Every idea, no matter what, was valid during this period. The idea generation and filtering/editing stages were entirely separate. As B.J. explained, “To me, everything is idea and execution and, if you separate idea and execution, you don’t put too much pressure on either of them.”\n\nJanuary 16, 2017\n\u001c367\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJanuary 16, 2017\n\u001c369\n\u0011\n\u0011\n\n\nGeneral Stanley McChrystal \u0026 Chris Fussell\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThree Practices for Mental Toughness The following was in response to “What are three tests or practices from the military that civilians could use to help develop mental toughness?”: STAN: “The first is to push yourself harder than you believe you’re capable of. You’ll find new depth inside yourself. The second is to put yourself in groups who share difficulties, discomfort. We used to call it ‘shared privation.’ You’ll find that when you have been through that kind of difficult environment, that you feel more strongly about that which you’re committed to. And finally, create some fear and make individuals overcome it.”\n\nJanuary 16, 2017\n\u001c420\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAround age 35 to 40, as you get up to battalion level, which is about 600 people, suddenly, you’re going to have to lead it a different way, and what you’re really going to have to do is develop people. Th e advice I’d give to anyone young is it’s really about developing people who are going to do the work. Unless you are going to go do the task yourself, then the development time you spend on the people who are going to do that task, whether they are going to lead people doing it or whether they are actually going to do it, every minute you spend on that is leveraged, is exponential return.”\n\nJanuary 16, 2017\n\u001c421\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJanuary 16, 2017\n\u001c421\n\u0011\n\u0011\n\n\nWill MacAskill\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJanuary 16, 2017\n\u001c427\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwhere the biggest predictor of job satisfaction is mentally engaging work. It’s the nature of the job itself. It’s not got that much to do with you. . . . It’s whether the job provides a lot of variety, gives you good feedback, allows you to exercise autonomy, contributes to the wider world—Is it actually meaningful? Is it making the world better?—and also, whether it allows you to exercise a skill that you’ve developed.”\n\nJanuary 16, 2017\n\u001c428\n\u0011\n\u0011\n\n\nKevin Costner\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“I started to fall in love with something. Didn’t know if I was going to be able to make a living at it, but I finally got rid of the whispers in my head [from my parents], which were ‘What are you going to be?’ And I’d say, ‘It’s none of your business. I’m going to be what I want to be.’” “When I articulated that I didn’t care anymore about what anybody thought about what I did except me, all the weight of the world came off my shoulders, and everything became possible. It shifted to everybody else [being] worried. Now they’re worried. But everything for me, it shifted\n\nJanuary 18, 2017\n\u001c432\n\u0011\n\u0011"},{"ty":"te","id":"i.69","spi":25379},{"ty":"te","id":"i.70","spi":25646},{"ty":"te","id":"i.71","spi":26070},{"ty":"te","id":"i.72","spi":26539},{"ty":"te","id":"i.73","spi":26678},{"ty":"te","id":"i.74","spi":26715},{"ty":"te","id":"i.75","spi":27191},{"ty":"te","id":"i.76","spi":27273},{"ty":"te","id":"i.77","spi":27940},{"ty":"te","id":"i.78","spi":28578},{"ty":"te","id":"i.79","spi":28632},{"ty":"te","id":"i.80","spi":28669},{"ty":"te","id":"i.81","spi":29149