n\u001cwisdom is nothing more than the ability to take your own advice. It’s actually very\n\nJanuary 18, 2017\n\u001c433\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ceasy to give people good advice. It’s very hard to follow the advice that you know is good\n\nJanuary 18, 2017\n\u001c433\n\u0011\n\u0011\n\n\nMy Favorite Thought Exercise: Fear-Setting\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMany a false step was made by standing still.” —Fortune cookie “Named must your fear be before banish it you can.” —Yoda, from Star Wars: The Empire Strikes Back\n\nJanuary 18, 2017\n\u001c442\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAction may not always bring happiness, but there is no happiness without action.” —Benjamin Disraeli, former British Prime Minister\n\nJanuary 18, 2017\n\u001c444\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat are you waiting for? If you cannot answer this without resorting to the BS concept of “good timing,” the answer is simple: You’re afraid, just like the rest of the world. Measure the cost of inaction, realize the unlikelihood and repairability of most missteps, and develop the most important habit of those who excel and enjoy doing so: action.\n\nJanuary 18, 2017\n\u001c448\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cProductivity is for robots. What humans are going to be really good at is asking questions, being creative, and\n\nJanuary 18, 2017\n\u001c448\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cexperiences\n\nJanuary 18, 2017\n\u001c448\n\u0011\n\u0011\n\n\nKevin Kelly\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWrite to Get Ideas, Not to Express Them “What I discovered, which is what many writers discover, is that I write in order to think. I’d say, ‘I think I have an idea,’ but when I begin to write it, I realize, ‘I have no idea,’ and I don’t actually know what I think until I try and write it. . . . That was the revelation\n\nJanuary 18, 2017\n\u001c450\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt’s the ones that keep coming back that I can’t kill and I can’t give away, that make me think, ‘Hmmm, maybe that’s the one I’m supposed to do.’”\n\nJanuary 18, 2017\n\u001c451\n\u0011\n\u0011\n\n\nIs This What I So Feared?\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthat a man’s peace of mind does not depend upon Fortune; for, even when angry, she grants enough for our needs.\n\nJanuary 18, 2017\n\u001c453\n\u0011\n\u0011\n\n\nAlain de Botton\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOffense Versus Defense “The more you know what you really want, and where you’re really going, the more what everybody else is doing starts to diminish. The moments when your own path is at its most ambiguous, [that’s when] the voices of others, the distracting chaos in which we live, the social media static start to loom large and become very threatening.”\n\nJanuary 19, 2017\n\u001c463\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTo blame someone for not understanding you fully is deeply unfair because, first of all, we don’t understand ourselves, and even if we do understand ourselves, we have such a hard time communicating ourselves to other people. Therefore, to be furious and enraged and bitter that people don’t get all of who we are is a really a cruel piece of immaturity.”\n\nJanuary 19, 2017\n\u001c463\n\u0011\n\u0011\n\n\nLazy: A Manifesto\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMore and more people in this country no longer make or do anything tangible; if your job wasn’t performed by a cat or a boa constrictor or a worm in a Tyrolean hat in a Richard Scarry book I’m not convinced it’s necessary. Yes, I know we’re all very busy, but what, exactly, is getting done? Are all those people running late for meetings and yelling on their cell phones stopping the spread of malaria or developing feasible alternatives to fossil fuels or making anything beautiful?\n\nJanuary 19, 2017\n\u001c468\n\u0011\n\u0011\n\n\nRick Rubin\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c✸ Advice to your younger self? “To be kinder to myself, because I think I’ve beaten myself up a lot. I expect a lot from myself, I’ll be hard on myself, and I don’t know that I’m doing anyone any good by doing that\n\nJanuary 19, 2017\n\u001c479\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou have an audience. People are willing to hear what you are interested in, what you’re interested in learning about, and what you want to share. You can do that without killing yourself. And killing yourself won’t be of service, neither to you nor your audience.”\n\nJanuary 19, 2017\n\u001c480\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut I would give him very doable homework assignments that almost seemed like a joke. ‘Tonight, I want you to write one word in this song that needs five lines, that you can’t finish. I just want one word that you like by tomorrow. Do you think that you could come up with one word?’”\n\nJanuary 19, 2017\n\u001c480\n\u0011\n\u0011"},{"ty":"te","id":"i.82","spi":29764},{"ty":"te","id":"i.83","spi":29833},{"ty":"te","id":"i.84","spi":29955},{"ty":"te","id":"i.85","spi":30129},{"ty":"te","id":"i.86","spi":30329},{"ty":"te","id":"i.87","spi":30499},{"ty":"te","id":"i.88","spi":30888},{"ty":"te","id":"i.89","spi":31038},{"ty":"te","id":"i.90","spi":31102},{"ty":"te","id":"i.91","spi":31461},{"ty":"te","id":"i.92","spi":31674},{"ty":"te","id":"i.93","spi":31842},{"ty":"te","id":"i.94","spi":32240},{"ty":"te","id":"i.95","spi":32654},{"ty":"te","id":"i.96","spi":33190},{"ty":"te","id":"i.97","spi":33443},{"ty":"te","id":"i.98","spi":33747},{"ty":"as","st":"paragraph","si":29755,"ei":29755,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_