fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":34036,"ei":34053,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="l+S+zDw0lPLRrihizAh9fDL2T1A"  nonce="l+S+zDw0lPLRrihizAh9fDL2T1A">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="l+S+zDw0lPLRrihizAh9fDL2T1A"  nonce="l+S+zDw0lPLRrihizAh9fDL2T1A">DOCS_modelChunk = [{"ty":"is","ibi":34061,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe Beginning Is “heart work,” not “head work” “So much of the job is more emotion and ‘heart work’ than it is ‘head work.’ The head comes in after, to look at what the heart has presented and to organize it. But the initial inspiration comes from a different place, and it’s not the head, and it’s not an intellectual activity.”\n\nJanuary 19, 2017\n\u001c480\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cReading great novels . . . seeing a great movie . . . reading poetry. . . . The only way to use the inspiration of other artists is if you submerge yourself in the greatest works of all time\n\nJanuary 19, 2017\n\u001c481\n\u0011\n\u0011\n\n\nMalcolm Gladwell\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe worst advice that, in general, we give in America is that we terrify high school kids about their college choices. All things related to college fall under the category of bad advice. As you will find out when you listen to my rants about college [on Revisionist History], I think the American college system needs to be blown up and they need to start over. . . . Am I so inspired by what I learned during the day that I want to be talking about it at 1:00 in the morning? And do I have someone who will have that conversation with me\n\nJanuary 19, 2017\n\u001c537\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cand who will challenge me? That’s it. Everything else is nonsense.”\n\nJanuary 19, 2017\n\u001c537\n\u0011\n\u0011\n\n\nStephen J. Dubner\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNow that may be true, but it also may not be true. Our point is, if you try to approach every problem with your moral compass, first and foremost, you’re going to make a lot of mistakes. You’re going to exclude a lot of possible good solutions. You’re going to assume you know a lot of things, when in fact you don’t, and you’re not\n\nJanuary 19, 2017\n\u001c538\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cgoing to be a good partner in reaching a solution with other people who don’t happen to see the world the way you do.”\n\nJanuary 19, 2017\n\u001c538\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat’s the worst advice you hear often? “‘Write what you know.’ Why would I want to write about what little I know? Don’t I want to use writing to learn more?”\n\nJanuary 19, 2017\n\u001c538\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAdvice to your younger self? “I would say it’s pretty simple: ‘Don’t be scared.’ There are a lot of things I did not do, a lot of\n\nJanuary 19, 2017\n\u001c539\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cexperiences I never tried, a lot of people I never met or hung out with because I was, in some form, intimidated or scared. . . . It also plays into what psychologists call the ‘spotlight effect,’ [as if] everybody must be caring about what I do. And the fact is: Nobody gives a crap what I do.”\n\nJanuary 19, 2017\n\u001c539\n\u0011\n\u0011\n\n\nJamie Foxx\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat’s on the other side of fear?” His answer is always, “Nothing.” He elaborates: “People are nervous for no reason, because no one’s gonna come out and slap you or beat you up. . . . When we talk about fear or a lack of being aggressive [holding someone back], it’s in your head.\n\nJanuary 19, 2017\n\u001c566\n\u0011\n\u0011"}
}'






